import Head from 'next/head'

function Tab(props) {
    return(
        <Head>
            <meta name="viewport" content="width=device-width" />
            <meta charset="utf-8" />
            <title>{props.title}</title>
            <link rel="icon" href="/apple-touch-icon.png"/>
        </Head>
    )
}

export default Tab
